import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { removeUserSession } from "./Utils/Common";
import { TimeoutLogic } from "./Utils/TimeoutLogic";

function Dashboard(props) {
  const [data, setData] = useState("");
  const navigate = useNavigate();

  console.log(data);
  const headers = {
    "Content-Type": "application/json",
    Authorization: `Bearer${"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJyZXN1bHQiOnsiaWQiOjEsIm5hbWUiOiJBZG1pbiIsImVtYWlsIjoiYWRtaW5AZ21haWwuY29tIiwiZW1haWxfdmVyaWZpZWRfYXQiOm51bGwsInJlbWVtYmVyX3Rva2VuIjpudWxsLCJjcmVhdGVkX2F0IjpudWxsLCJ1cGRhdGVkX2F0IjpudWxsLCJyb2xlIjoiYWRtaW4iLCJwYXNzd29yZF9kaWdlc3QiOm51bGx9LCJpYXQiOjE2Njc5NzEyNzgsImV4cCI6MTY2Nzk3ODQ3OH0._k8jZzA0t3jFm-D9ifAXZUBY_I_yS6cvYO4KKn2d0us"}`,
  };

  useEffect(() => {
    axios
      .get(
        "https://8471-103-141-51-42.in.ngrok.io/api/v1/year",
        { headers: headers },

      )
      .then((res) => {
        setData(res.data);
      });
  });

  const handleLogout = () => {
    removeUserSession();
    navigate("/");
  };

  return (
    <div className="container log bg-dark text-white">
      Welcome to Dashboard !<br />
      <br />
      <input
        type="button"
        className=" btn btn-primary"
        onClick={handleLogout}
        value="Logout"
      />
      <TimeoutLogic />
    </div>
  );
}

export default Dashboard;
